import './App.css';
import PropTypes from 'prop-types';
import ChatBot from './ChatBot';
import Header from './Header';
import Home from './Home';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Menu from './Menu';
import FormsList from './FormsList';
import { React, useState, Component } from 'react';
// import OCR from './OCR';
import './OCR.css';
import MarkTemp from './MarkTemp';
import Login from './Login';
// import Signup from './Signup';
import ViewUsers from './ViewUsers';
// import Logout from './Logout';
import PrevTemplates from './PrevTemplates';
import ShowTemplate from './ShowTemplate';
import ShowData from './ShowData';
import GetData from './GetData';
import PersistentDrawerLeft from './PersistentDrawerLeft';
import ViewData from './ViewData';

class App extends Component {
  constructor() {
    super();
    this.state = {
      loggedin: localStorage.getItem("username")
    };
    // this.state = {
    //   formData: {
    //     username: "",
    //     password: "",
    //   },
    //   submitted: false,
    //   error : null,
    //   loggedin : localStorage.getItem("username")
    // }
    // this.handleUChange = this.handleUChange.bind(this);
    // this.handlePChange = this.handlePChange.bind(this);
    // this.handleSubmit = this.handleSubmit.bind(this);
  }
  // static contextTypes={
  //   router: PropTypes.object,
  // }

  render() {
    // const { classes } = this.props; 
    let dict = {};
    if (this.state.loggedin == null) {
      dict['Signup/Login'] = '/login';
    }
    else {
      console.log("ADad");
      dict['Mark Template'] = '/marktemp';
      dict['Get Data'] = '/getdata';
      dict['Previous Templates'] = '/prevtemplates';
      if (this.state.loggedin === "admin")
        dict['View Users'] = '/users';
      dict['Logout'] = '/logout';
    }


    return (

      <div>
        {/* <OCR/> */}
        <Router>
          <Switch>
            <Route exact path='/login' component={Login} />
            <Route exact path='/marktemp' element={<>
              <PersistentDrawerLeft options={dict}/>
              <MarkTemp />
            </>}>
            </Route>
            {/* <Route exact path='/login' component={Login} /> */}
            {/* <Route exact path='/signup' component={Signup} /> */}
            <Route exact path='/users' element={<>
              <PersistentDrawerLeft options={dict}/>
              <ViewUsers />
            </>}>
            </Route>
            {/* <Route exact path='/logout' component={Logout} /> */}
            <Route exact path='/prevtemplates' element={<>
              <PersistentDrawerLeft options={dict}/>
              <PrevTemplates />
            </>}>
            </Route>
            <Route exact path='/template/:tid' element={<>
              <PersistentDrawerLeft options={dict}/>
              <ShowTemplate />
            </>}>
            </Route>
            <Route exact path='/data/:tid' element={<>
              <PersistentDrawerLeft options={dict}/>
              <ShowData />
            </>}>
            </Route>
            <Route exact path='/getdata' element={<>
              <PersistentDrawerLeft options={dict}/>
              <GetData />
            </>}>
            </Route>
            <Route exact path='/viewdata/:tid/:did' element={<>
              <PersistentDrawerLeft options={dict}/>
              <ViewData />
            </>}>
            </Route>
            {/* <Route exact path='/ocr' Component={OCR} /> */}
            <Route exact path='/formsList' element={<>
              <Header />
              <FormsList />
            </>}>
            </Route>
            <Route exact path='/menu' element={<>
              <Header />
              <Menu />
            </>}>
            </Route>
            <Route exact path='/chatBot' element={<>
              <Header />
              <ChatBot />
            </>}>
            </Route>
            <Route exact path='/' element={<>
              <Header />
              <Home />
            </>}>
            </Route>
          </Switch>
        </Router>
      </div>
    );
  }
}
// App.propTypes = {
//   classes: PropTypes.object.isRequired,
// };

export default App;
